import React from 'react';
import './style.css';
import Button from './components/Button/Button';

export default function App() {
  return (
    <div>
      <h1>Hello StackBlitz!</h1>
      <p>Start editing to see some magic happen :)</p>
      <Button
        variant={'primary'}
      >
        Test
      </Button>
    </div>
  );
}
